import React from "react";
import Card from "../../component/Card";
import "./project.css";

function Projects() {
  return (
    <>
      <div className="project-card-conatiner">
        <h1>PROJECTS</h1>
        <div className="card-wrapper">
          <div className="card-first">
            <Card />
            <Card />
            <Card />
          </div>
          <div className="card-second">
            <Card />
            <Card />
          </div>
        </div>
      </div>
    </>
  );
}

export default Projects;
